import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";import{o as t,c as a,e as o}from"./app.9b6c14fa.js";const i={},p=o('<h1 id="bat\u5927\u4F6C\u7684\u5237\u9898\u7B14\u8BB0" tabindex="-1"><a class="header-anchor" href="#bat\u5927\u4F6C\u7684\u5237\u9898\u7B14\u8BB0" aria-hidden="true">#</a> BAT\u5927\u4F6C\u7684\u5237\u9898\u7B14\u8BB0</h1><p><strong>\u5927\u5BB6\u5E94\u8BE5\u90FD\u77E5\u9053\uFF0C\u73B0\u5728\u7684\u4E92\u8054\u7F51\u516C\u53F8\u9762\u8BD5\uFF0C\u53EA\u8981\u662F\u7814\u53D1\u5C97\u4F4D\uFF0C\u57FA\u672C\u4E0A\u90FD\u8DD1\u4E0D\u4E86\u7B97\u6CD5\u9898\u7684\u6298\u78E8\uFF0C\u6240\u4EE5\u5927\u5BB6\u5728\u51C6\u5907\u6821\u62DB\u548C\u793E\u62DB\u7684\u65F6\u5019\uFF0C\u6216\u8005\u4E1A\u4F59\u65F6\u95F4\uFF0C\u8FD8\u662F\u8981\u591A\u5237\u5237 LeetCode\uFF0C\u4FDD\u6301\u72B6\u6001\u7684</strong>\u3002</p><p>\u9700\u8981\u5237\u9898\u7B14\u8BB0\u7684\u5C0F\u4F19\u4F34\u8BF7\u626B\u63CF\u4E0B\u65B9\u7684\u4E8C\u7EF4\u7801\u5173\u6CE8\u4F5C\u8005\u7684\u539F\u521B\u516C\u4F17\u53F7\u300C<strong>\u6C89\u9ED8\u738B\u4E8C</strong>\u300D\u56DE\u590D\u5173\u952E\u5B57\u300C<strong>100</strong>\u300D\u5C31\u53EF\u4EE5\u62C9\u53D6\u5230\u4E0B\u8F7D\u94FE\u63A5\u4E86\u3002</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png" alt="\u626B\u7801\u5173\u6CE8\u540E\u56DE\u590D\u300C100\u300D\u5173\u952E\u5B57" loading="lazy"></p><blockquote><p>\u4E8C\u54E5\uFF0C\u53BB\u5E74\u6821\u62DB\u524D\u51C6\u5907\u7B97\u6CD5\u65F6\uFF0C\u6211\u5728 LeetCode \u4E0A\u5237\u4E86\u5F88\u591A\u9898\uFF0C\u4F46\u603B\u611F\u89C9\u9898\u867D\u7136\u5237\u4E86\u5F88\u591A\uFF0C\u89E3\u9898\u80FD\u529B\u5374\u6CA1\u600E\u4E48\u63D0\u9AD8\uFF0C\u600E\u4E48\u89E3\u51B3\u8FD9\u79CD\u5237\u9898\u6548\u7387\u4F4E\u4E0B\u7684\u95EE\u9898\u5462\uFF1F</p></blockquote><p>\u8FD9\u662F\u4E09\u4E2A\u6708\u524D\u4E00\u4E2A\u8BFB\u8005\u7ED9\u6211\u7684\u79C1\u4FE1\uFF0C\u4ED6\u7684\u56F0\u60D1\u8BA9\u6211\u5FC3\u6709\u621A\u621A\u7109\uFF01\u4E8E\u662F\u6211\u8D76\u7D27\u95EE\u4E86\u8EAB\u8FB9\u7684\u4E00\u4E9B\u5C31\u804C\u4E8E\u5927\u5382\u7684\u670B\u53CB\uFF0C\u4ED6\u4EEC\u4E0D\u7EA6\u800C\u540C\u5730\u7ED9\u6211\u63A8\u8350\u4E86\u8FD9\u4EFD\u5237\u9898\u7B14\u8BB0\u3002</p><p><img src="https://upload-images.jianshu.io/upload_images/1179389-1a258005b1ace2ff?imageMogr2/auto-orient/strip|imageView2/2/w/1240" alt="" loading="lazy"></p><p>\u7EC6\u81F4\u5730\u7814\u7A76\u4E86\u4E00\u5468\u540E\uFF0C\u6211\u611F\u89C9\u53D1\u73B0\u4E86\u5B9D\u85CF\uFF01\u8D76\u7D27\u53D1\u7ED9\u4E86\u8FD9\u4F4D\u8BFB\u8005\u3002\u524D\u5929\uFF0C\u4ED6\u56DE\u590D\u6211\u4E86\uFF0C\u8BF4\uFF1A\u201C\u4E8C\u54E5\uFF0C\u4F60\u592A\u5F3A\u4E86\uFF0C<strong>\u8FD9\u5237\u9898\u7B14\u8BB0\u597D\u4F7F\u554A</strong>\u3002\u6211\u6309\u7167\u4E0A\u9762\u63D0\u4F9B\u7684\u65B9\u6CD5\u8BA4\u771F\u5730\u5237\u4E86\u4E24\u4E2A\u6708\u7684\u65F6\u95F4\uFF0C\u60CA\u5947\u5730\u53D1\u73B0\u7B97\u6CD5\u80FD\u529B\u63D0\u9AD8\u4E86\uFF0C\u5237 LeetCode \u4E0A\u4E2D\u7B49\u96BE\u5EA6\u7684\u9898\u76EE\u57FA\u672C\u4E0D\u4F1A\u88AB\u5361\u4F4F\u4E86\uFF01\u201D</p><p>\u542C\u4ED6\u8FD9\u4E48\u4E00\u8BF4\uFF0C\u6211\u5C31\u6709\u4FE1\u5FC3\u4E86\uFF0C\u8D76\u7D27\u7ED9\u6211\u516C\u4F17\u53F7\u7684\u8BFB\u8005\u670B\u53CB\u4EEC\u5206\u4EAB\u4E00\u4E0B\u3002</p><p>\u8FD9\u672C\u7B14\u8BB0\u7684\u4F5C\u8005\u5728 LeetCode \u5237\u4E86\u51E0\u767E\u9053\u9898\uFF0C\u5E76\u4E14\u5C06\u9898\u76EE\u5206\u95E8\u522B\u7C7B\u5730\u6574\u7406\u597D\u4E86\u3002\u5305\u542B\u4E86 LeetCode Online Judge \u6240\u6709\u9898\u76EE\u7684\u7B54\u6848\uFF0C\u6240\u6709\u7684\u4EE3\u7801\u5B9E\u73B0\u662F\u975E\u5E38\u4F18\u96C5\u4E14\u6267\u884C\u6548\u7387\u6781\u9AD8\u7684\u3002</p><p>\u4E0D\u7BA1\u4F60\u4F7F\u7528\u7684\u7F16\u7A0B\u8BED\u8A00\u662F Java\u3001C++\uFF0C\u8FD8\u662F Go\uFF0C\u90FD\u53EF\u4EE5\u5B66\u4E60\uFF0C\u9002\u5408\u5237\u9898\u7684\u540C\u5B66\u53CD\u590D\u5B66\u4E60\u3002\u8BA4\u771F\u5730\u63E3\u6469\u5176\u4E2D\u7684\u6846\u67B6\u601D\u7EF4\uFF0C\u4F60\u4F1A\u53D1\u73B0\uFF0C\u8FD9\u662F\u4E00\u672C\u975E\u5E38\u7528\u5FC3\u7684\u5237\u9898\u7C7B\u4E66\u7C4D\u3002\u7B14\u8BB0\u603B\u5171 1200 \u9875\uFF0C\u5206\u7F16\u7A0B\u6280\u5DE7\u3001\u7EBF\u6027\u8868\u3001\u5B57\u7B26\u4E32\u3001\u6808\u961F\u5217\u3001\u6811\u3001\u6392\u5E8F\u3001\u67E5\u627E\u3001BFS\u3001DFS\u3001\u8D2A\u5FC3\u3001\u52A8\u6001\u89C4\u5212\u7B49\u3002</p><p><img src="https://upload-images.jianshu.io/upload_images/1179389-5903188fb91d382a?imageMogr2/auto-orient/strip|imageView2/2/w/1240" alt="" loading="lazy"></p><p>\u6BCF\u4E2A\u7AE0\u8282\u90FD\u4F1A\u5148\u8BB2\u89E3\u6846\u67B6\u601D\u7EF4\uFF0C\u7136\u540E\u6311\u9009\u975E\u5E38\u5178\u578B\u7684\u5341\u51E0\u9053 LeetCode \u9898\u8FDB\u884C\u5B9E\u6218\u8BB2\u89E3\u3002\u8FD9\u4EFD\u7B14\u8BB0\u4E0D\u4EC5\u6392\u7248\u5341\u5206\u7CBE\u7F8E\uFF0C\u5185\u5BB9\u4E5F\u5F02\u5E38\u5145\u5B9E\uFF0C\u6BCF\u4E00\u9898\u90FD\u662F\u7EC6\u81F4\u7684\u8BB2\u89E3\uFF0C\u6709\u65F6\u5019\u8FD8\u4F1A\u914D\u4E0A\u56FE\u7247\uFF0C\u5C31\u6015\u4F60\u641E\u4E0D\u61C2\uFF0C\u5927\u5927\u7684\u826F\u5FC3\u554A\uFF01</p><p><img src="https://upload-images.jianshu.io/upload_images/1179389-38d3c702ad2c6db5?imageMogr2/auto-orient/strip|imageView2/2/w/1240" alt="" loading="lazy"></p><p><img src="https://upload-images.jianshu.io/upload_images/1179389-e69bdf5643318d02?imageMogr2/auto-orient/strip|imageView2/2/w/1240" alt="" loading="lazy"></p><p>\u4EE5\u524D\u5462\uFF0C\u6211\u4E5F\u5F88\u8BA8\u538C\u5237\u9898\uFF0C\u89C9\u5F97\u8FD9\u5C31\u50CF\u53E4\u4EE3\u7684\u516B\u80A1\u6587\u4E00\u6837\uFF0C\u53C8\u81ED\u53C8\u523B\u677F\uFF0C\u4F46\u4E92\u8054\u7F51\u7684\u516C\u53F8\u90FD\u559C\u6B22\u8FD9\u4E48\u8003\uFF0C\u56E0\u4E3A\u786E\u5B9E\u4E5F\u627E\u4E0D\u5230\u66F4\u597D\u7684\u66FF\u4EE3\u65B9\u6848\uFF0C\u90A3\u5982\u679C\u4F60\u4E0D\u51C6\u5907\u4E0D\u53BB\u5237 LeetCode \u7684\u8BDD\uFF0C\u9762\u8BD5\u5FC5\u5B9A\u6302\u554A\uFF01</p><p>\u7ECF\u5E38\u5237\u9898\u7684\u8BFB\u8005\u53EF\u80FD\u4F1A\u77E5\u9053\uFF0CBeats 100% \u662F\u5F88\u6709\u96BE\u5EA6\u7684\uFF1A</p><ul><li>\u4EE3\u7801\u8981\u8A00\u7B80\u610F\u8D45\uFF0C\u4E00\u9488\u89C1\u8840</li><li>\u7B97\u6CD5\u5FC5\u987B\u662F\u6700\u4F18\u89E3</li></ul><p>\u90A3<strong>\u8FD9\u4EFD\u5237\u9898\u7B14\u8BB0\u4E2D\u6240\u6709\u9898\u76EE\u7684\u89E3\u7B54\uFF0C\u90FD\u662F Beats 100%</strong>\uFF0C\u8FD9\u4E00\u70B9\u975E\u5E38\u96BE\u80FD\u53EF\u8D35\uFF01\u4E5F\u5C31\u662F\u8BF4\uFF0C\u8FD9\u4EFD\u5237\u9898\u7B14\u8BB0\u4E2D\u7684\u89E3\u7B54\u90FD\u662F\u5927\u5382\u8003\u6838\u65F6\u5019\u7684\u6807\u51C6\u7B54\u6848\uFF0C\u5982\u679C\u8BF4\u4F60\u5403\u900F\u4E86\u8FD9\u4EFD\u5237\u9898\u7B14\u8BB0\uFF0C\u53EF\u4EE5\u540A\u6253\u9762\u8BD5\u5B98\u4E86\u2014\u2014\u5F53\u7136\u4E86\uFF0C\u5403\u900F\u4F1A\u6BD4\u8F83\u96BE\uFF0C\u4F46\u5982\u679C\u80FD\u5E94\u4ED8\u9762\u8BD5\uFF0C\u5C31\u76F4\u4E86\u5440\uFF0C\u4E0D\u4E0D\u4E0D\uFF0C\u5C31\u503C\u4E86\u5440\uFF01</p><p>\u4E8C\u54E5\u5DF2\u7ECF\u628A\u8FD9\u4EFD\u5237\u9898\u7B14\u8BB0\u4E0B\u8F7D\u597D\u4E86\uFF0C\u9700\u8981\u7684\u5C0F\u4F19\u4F34\u8BF7\u626B\u63CF\u4E0B\u65B9\u7684\u4E8C\u7EF4\u7801\u5173\u6CE8\u4F5C\u8005\u7684\u539F\u521B\u516C\u4F17\u53F7\u300C<strong>\u6C89\u9ED8\u738B\u4E8C</strong>\u300D\u56DE\u590D\u5173\u952E\u5B57\u300C<strong>100</strong>\u300D\u5C31\u53EF\u4EE5\u62C9\u53D6\u5230\u4E0B\u8F7D\u94FE\u63A5\u4E86\uFF08\u65E0\u5957\u8DEF\uFF0C\u6CA1\u52A0\u5BC6\uFF09\u3002</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/gongzhonghao.png" alt="\u626B\u7801\u5173\u6CE8\u540E\u56DE\u590D\u300C100\u300D\u5173\u952E\u5B57" loading="lazy"></p><blockquote><p>\u7B14\u8BB0\u7248\u6743\u5F52\u539F\u4F5C\u8005\uFF08\u971C\u795E\uFF09\u6240\u6709\uFF0C\u51FA\u5904\uFF1Ahttps://books.halfrost.com/leetcode/</p></blockquote>',22),s=[p];function r(g,n){return t(),a("div",null,s)}var c=e(i,[["render",r],["__file","bat-shuati.html.vue"]]);export{c as default};
